import React from 'react'
import './Recomended.css'
function Recomended() {
  return (
    <section className="recomended">
        <h1>Recomended</h1>
        <div className="buttons">
            
            <button>Nike</button>
            <button>Addidas</button>
            <button>Puma</button>
            <button>Vans</button>
        </div>
    </section>
  )
}




 function Button() {
  return (
    <button>All Products</button>
  )
}




export default Recomended
